import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';

let fakeServerData ={
  user: {
    name: "Steven",
    playlists:[
      {name: "Pop",
      songs:["Beat it"]
      },
      {},
      {}
    ]
  }
}
class Aggregate extends Component {
  render(){
    return(
      <div style={{ width:'40%',display:'inline-block'}}>
        <h2>Number Text</h2>
      </div>
    )
  }
}

class Filter extends Component{
  render() {
    return (
      <div>
        <img/>
        <input type="text"/>
      </div>
    )
  }
}

class Playlist extends Component{
  render(){
    return (
      <div style={{width:"25%", display:"inline-block"}}>
        <img/> 
        <h3>Playlist Name</h3>
        <ul>
          <li>Song 1</li>
          <li>Song 2</li>
          <li>Song 3</li>
        </ul>
      </div>
    );
  }
}

class App extends Component {
  constructor(){
    super();
    this.state = {serverData:{}}
  }
  componentDidMount(){
    this.setState({serverData: fakeServerData});
  }
  render() { 
    return (
      <div className="App">
        <h1 className="App-header">
        {this.state.serverData.user && this.state.serverData.user.name}'s Favorite Playlists
        </h1>
        <Aggregate/>
        <Aggregate/>
        <Filter/>
        <Playlist/>
        <Playlist/>
        <Playlist/>
      </div>
    );
  }
}

export default App;
